import Vue from 'vue'
import Vuex from 'vuex'
import RandomUserGenerator from './RandomUserGenerator.vue';

Vue.use(Vuex)

export default new Vuex.Store({
    state: {
        generatedProfile: {}
      },
      mutations: {
        setGeneratedProfile(state, data) {
          state.generatedProfile = data;
        }
      }
})
